import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import AddAirplaneForm from './components/AddAirplaneForm';

export default function App() {
  return (
    <div>
      <nav>
        <Link to="/add-airplane">Add Airplane</Link>
      </nav>
      <Routes>
        <Route path="/add-airplane" element={<AddAirplaneForm />} />
        <Route path="*" element={<div>Select a page</div>} />
      </Routes>
    </div>
  );
}
